import { makeStyles } from '@material-ui/core/styles';

const FooterStyle = makeStyles((theme) => ({
  bar: {
    backgroundColor: '#333333',
    bottom: 0,
    flexGrow: 1,
    top: 'auto',
  },
  orange: {
    color: '#FF8700',
  },
  orangeText: {
    color: '#FF8700',
    marginLeft: theme.spacing(1),
    background: 'transparent',
  },
}));

export default FooterStyle;
